import axios from "axios";
import React, { useEffect, useRef, useState } from "react";
import styled from "styled-components";
import { toast } from "react-toastify";


const FormContainer = styled.form`
    display: flex;
    align-items: flex-end;
    gap: 10px;
    flex-wrap: wrap;
    background-color: #fff;
    padding: 20px;
    box-shadow: 0px 0px 5px #ccc;
    border-radius: 5px;
`;

const InputArea = styled.div`
    display: flex;
    flex-direction: column;
`;

const Input = styled.input`
    width: 145px;
    padding: 0 10px;
    border: 1px solid #bbb;
    height: 40px;
    cursor: text;
`;

const Button = styled.button`
    padding: 10px;
    cursor: pointer;
    border-radius: 5px;
    border: none;
    background-color: #2c73d2;
    color: white;
    height: 42px;
`;

const Label = styled.label``;

const Form = ({ getUsers, onEdit, setOnEdit }) => {
    const nomeRef = useRef();
    const emailRef = useRef();
    const senhaRef = useRef();
    const telefoneRef = useRef();
    const dataNascRef = useRef();

    useEffect(() => {
        if (onEdit) {
            nomeRef.current.value = onEdit.nome;
            emailRef.current.value = onEdit.email;
            senhaRef.current.value = onEdit.senha;
            telefoneRef.current.value = onEdit.telefone;
            dataNascRef.current.value = onEdit.data_nasc;
        }
    }, [onEdit]);

    const handleSubmit = async (e) => {
        e.preventDefault();

        const nome = nomeRef.current.value;
        const email = emailRef.current.value;
        const senha = senhaRef.current.value;
        const telefone = telefoneRef.current.value;
        const data_nasc = dataNascRef.current.value;

        if (!nome || !email || !senha || !telefone || !data_nasc) {
            return toast.warn("Preencha todos os campos!");
        }

        if (onEdit) {
            await axios
                .put("http://localhost:8800/" + onEdit.id, {
                    nome,
                    email,
                    senha,
                    telefone,
                    data_nasc,
                })
                .then(({ data }) => toast.success(data))
                .catch(({ data }) => toast.error(data));
        } else {
            await axios
                .post("http://localhost:8800", {
                    nome,
                    email,
                    senha,
                    telefone,
                    data_nasc,
                })
                .then(({ data }) => toast.success(data))
                .catch(({ data }) => toast.error(data));
        }

        nomeRef.current.value = "";  // Limpando os campos
        emailRef.current.value = "";
        senhaRef.current.value = "";
        telefoneRef.current.value = "";
        dataNascRef.current.value = "";

        setOnEdit(null);
        getUsers();
    };

    return (
        <FormContainer onSubmit={handleSubmit}>
            <InputArea>
                <Label>Nome</Label>
                <Input name="nome" ref={nomeRef} />
            </InputArea>
            <InputArea>
                <Label>E-mail</Label>
                <Input name="email" type="email" ref={emailRef} />
            </InputArea>
            <InputArea>
                <Label>Senha</Label>
                <Input name="senha" type="password" ref={senhaRef} />
            </InputArea>
            <InputArea>
                <Label>Telefone</Label>
                <Input name="telefone" ref={telefoneRef} />
            </InputArea>
            <InputArea>
                <Label>Data de Nascimento</Label>
                <Input name="data_nasc" type="date" ref={dataNascRef} />
            </InputArea>

            <Button type="submit">SALVAR</Button>
        </FormContainer>
    );
}

export default Form;
